拍摄着他的照片。在他的照片中丽安的身影占据了很大部分，他爱上了丽安。太普最难以忍受的事情就是每晚都能听到在父亲的身体下痛苦的呻吟，乃至惨叫的丽安的声音。夜里，他常常去偷窥，当看到那不忍入目的场面之后，他甚至想打死父亲。这更激起了他对父亲的恨。太普的母亲就是因为查永总这样对待她而红杏出墙，在查永发现并打了她后开枪自杀。太普的离家出走也是因为此事。丽安也爱上了这个“儿子”。但她和太普一样不敢越雷池一步。但爱的力量是强大的，在一次出海时，他们游过海中的一个山洞，丽安在水中给快要窒息的太普嘴对嘴的换气。从水中出来后，他们拥在一起热吻，在沙滩上忘情地做爱。丽安第一次体验到了性爱之美。欲望如山洪暴发，一发而不可收拾。两个情欲难耐的情人只能在闹市的一个角落里亲热。一天，查永告诉他们自己要去出海几天。两个解放了的情侣在家里，在海边尽情地做爱……太普要走了，他们已经商量好了要私奔。但丽安从房子旁边的烟头中发现查永早已经知道了他们的事情。等待他们的将是那残暴的查永。两个人的命运就如那波涛汹涌的大海，无比激荡，但也会毁灭掉一切。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:55:"BD$https://eth.ppzuida.com/20181019/t8lHoGJD/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids";N;}s:6:"type_1";N;}i:17;a:80:{s:6:"vod_id";i:62023;s:7:"type_id";i:20;s:9:"type_id_1";i:0;s:8:"group_id";i:0;s:8:"vod_name";s:9:"月披岛";s:7:"vod_sub";s:0:"";s:6:"vod_en";s:8:"yuepidao";s:10:"vod_status";i:1;s:10:"vod_letter";s:1:"Y";s:9:"vod_color";s:0:"";s:7:"vod_tag";s:0:"";s:9:"vod_class";s:6:"伦理";s:7:"vod_pic";s:77:"https://img.tupian-zuida.com/pic/upload/vod/2018-11-27/201811271543304547.jpg";s:13:"vod_pic_thumb";s:0:"";s:13:"vod_pic_slide";s:0:"";s:9:"vod_actor";s:8:"Pinmanee";s:12:"vod_director";s:7:"Nakarin";s:10:"vod_writer";s:0:"";s:10:"vod_behind";s:0:"";s:9:"vod_blurb";s:220:"3年前被谋杀的，但她的灵魂被